import React from "react";
import { useNavigate, BrowserRouter, Routes, Route } from "react-router-dom";
import styles from './Base.module.css'



function Base(){

    return(
        <div className={styles.container}>
            <div className={styles.left_link}>
                <img className={styles.img} src="./img/free-icon-man-658032.png" alt="Image"></img>
                <nav>
                    <ul>
                        <li><a className={styles.Menu1} href="#">Menu1</a></li>
                        <li><a className={styles.Menu2} href="#">Menu2</a></li>

                    </ul>


                </nav>


            </div>


            <a className={styles.right_link} href="login">Login</a>

        </div>
    )
};

export default Base;
